Update decoding_tutorial.rst

- Fix a couple of typos;
- Change `X` to `fmri_masked` and `y` to `target`, for consistency (and allowing all the inlined code to be copied/pasted without any trouble);
- For the same reason, defining `n_conditions = len(set(target))` manually;
- In the beginning, before downloading the data, warning about the time and size required for fetching them;
- A `classification_accuracy` was displayed `1.000`, it is misleading as a 100% accuracy is almost never achievable;
- Update displayed signature of a sklearn.svm.SVC object (eps is now called tol, default cache_size is 200 Mb).

Typo "trouble.."  "trouble."

- Typo "trouble.."  "trouble";
- Typo, two lines were swapped (interlacing a <p>..</p> and a <a>..</a> for Windows reference).

English typos on nilearn/decoding/space_net.py doc

On [nilearn/decoding/space_net.py](https://nilearn.github.io/modules/generated/nilearn.decoding.SpaceNetClassifier.html#nilearn.decoding.SpaceNetClassifier):

- [X] English typos on the doc ("are are the"  "are the", "humain"  "human", and other typos);
- [X] ``not self.loss is None``  ``self.loss is not None``, as advised by pylint/pep8/flake;
- [X] Changing default cv value in the documentation (10  8) according the what the code uses as default value (8, not 10);

Typo "trouble.."  "trouble."

- Typo "trouble.."  "trouble";
- Typo, two lines were swapped (interlacing a <p>..</p> and a <a>..</a> for Windows reference).

Update decoding_tutorial.rst

- Fix a couple of typos;
- Change `X` to `fmri_masked` and `y` to `target`, for consistency (and allowing all the inlined code to be copied/pasted without any trouble);
- For the same reason, defining `n_conditions = len(set(target))` manually;
- In the beginning, before downloading the data, warning about the time and size required for fetching them;
- A `classification_accuracy` was displayed `1.000`, it is misleading as a 100% accuracy is almost never achievable;
- Update displayed signature of a sklearn.svm.SVC object (eps is now called tol, default cache_size is 200 Mb).

English typos on nilearn/decoding/space_net.py doc

On [nilearn/decoding/space_net.py](https://nilearn.github.io/modules/generated/nilearn.decoding.SpaceNetClassifier.html#nilearn.decoding.SpaceNetClassifier):

- [X] English typos on the doc ("are are the"  "are the", "humain"  "human", and other typos);
- [X] ``not self.loss is None``  ``self.loss is not None``, as advised by pylint/pep8/flake;
- [X] Changing default cv value in the documentation (10  8) according the what the code uses as default value (8, not 10);
